import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './screens/Login';
import Register from './screens/Register';
import ProjectCreate from './screens/ProjectCreate';
import ProjectList from './screens/ProjectList';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/login" component={Login} />
        <Route path="/register" component={Register} />
        <Route path="/create-project" component={ProjectCreate} />
        <Route path="/projects" component={ProjectList} />
        {/* Puedes agregar una ruta para redirigir a otro sitio si no quieres que Home se muestre */}
        <Route exact path="/" render={() => <h1>Bienvenido</h1>} />
      </Switch>
    </Router>
  );
}

export default App;
